import React, { Component } from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Button from 'react-bootstrap/Button'
import Form from 'react-bootstrap/Form'
import FormControl from 'react-bootstrap/FormControl'
import './navigationbar-styles.css';


import { Link } from "react-router-dom";



class NavigationBar extends Component {

  state = {
    isOpen: false,
    isOpen2: false,
    isOpen3: false

  };

  toggleOpen = () => this.setState({ isOpen: !this.state.isOpen });
  toggleOpen2 = () => this.setState({ isOpen2: !this.state.isOpen2 });
  toggleOpen3 = () => this.setState({ isOpen3: !this.state.isOpen2 });


    render(){
      const menuClass = `dropdown-menu${this.state.isOpen ? " show" : ""}`;
      const menuClass2 = `dropdown-menu${this.state.isOpen2 ? " show" : ""}`;
      const menuClass3 = `dropdown-menu${this.state.isOpen3 ? " show" : ""}`;

        return (

          <div>
            <Navbar variant="dark" >
            <Navbar.Brand href="/home" className = "navLogo" >
              < img src= "./logo.png"width="70" height="70"alt="EZiBuy logo"/>
          </Navbar.Brand>

              <Nav className="mr-auto">

                <li><Link className="NavLink" to="/home">EzIBuy</Link></li>                

                <div className="dropdown" >

                  <li><Link className="dropdown-toggle NavLink" onClick={this.toggleOpen} to="/home">Categorias</Link></li>
                  <div className={menuClass}>

                    <li><Link className="dropdown-item" to="/home">Celulares</Link></li>
                    <li><Link className="dropdown-item" to="/home">Carros</Link></li>

                    <div className="btn-group dropright" onClick={this.toggleOpen3}>
                       <li><Link className="dropdown-toggle" to="/">Carros</Link></li>
                        <div className={menuClass3}>
                            <div className="dropdown-mennu">
                            <li><Link className="dropdown-item" to="/home">Automoviles usados</Link></li>
                            <li><Link className="dropdown-item" to="/home">Automoviles nuevos</Link></li> 
                            <li><Link className="dropdown-item" to="/home">Camionetas</Link></li>
                            <li><Link className="dropdown-item" to="/home">Barcos</Link></li>                                              
                          </div>
                        </div>
                    </div>

                    <div className="btn-group dropright" onClick={this.toggleOpen2}>
                      <a  class="btn dropdown-toggle" data-toggle="dropdown">Otros</a>
                        <div className={menuClass2}>
                            <div className="dropdown-mennu">
                            <li><Link className="dropdown-item" to="/home">Servicios</Link></li>
                            <li><Link className="dropdown-item" to="/home">Electrodomesticos</Link></li>     
                            <div class="dropdown-divider"></div>
                            <li><Link className="dropdown-item" to="/home">Y mucho más...</Link></li>
                          </div>
                        </div>
                    </div>
                  </div>
                </div>

                <li><Link className="NavLink" to="/login">Ingresar</Link></li>
                <li><Link className="NavLink" to="/">Registrarse</Link></li>
                <li><Link className="NavLink" to="/invoice">...</Link></li>

              </Nav>

              <Form inline>
                <FormControl type="text" placeholder="Buscar" className="mr-sm-2" />
                <Button variant="outline-light">Buscar</Button>
              </Form>
            </Navbar>
          </div>

        );
    }
}

export default NavigationBar;
